import React from "react";

const Favorite = () => {
    return (
        <div className="container has-background-warning">
            <div className="columns is-fullheight-with-navbar">
                <div className="column is-4 has-background-danger"></div>
                <div className="column is-4 has-background-info"></div>
                <div className="column is-4 has-background-grey"></div>
            </div>
        </div>
    )
};

export default Favorite;
